description:
Crescendo 2012 (Wicked Pictures) [DVDRip]

Jayna Oso, Kirsten Price, Jenaveve Jolie, Vanessa Monet, Lily Paige, Ariel X

BUD and CARLA - two old friends, have gotten together on the night of December 20th, 2012 to usher in a very different type of New Year. Bud and Carla believe this date to be a very special occasion, when according to ancient Mayan civilization, the world as we know it will end. They decide to ride out the end in style, with a sex filled orgy. And they've invited some guests along for the ride. In the last wild night of modern humanity, Bud and Carla will party . . . And, as they near closer to the magical moment when the clock strikes midnight, they will realize that it's not just sex that we have to celebrate, but LOVE as well. These two plutonic friends will find love at the end of the rainbow and carry it with them into the eternal night of a very lovely new day.


